. The api is located at https://api.graphql.com/graphql. The api expects a query of the form:
```
mutation {
  createPost(input: {
    title: "My First Post",
    content: "This is my first post!"
  }) {
    post {
      title
      content
    }
  }
}
```
The api will return a json response of the form:
```
{
  "data": {
    "createPost": {
      "post": {
        "title": "My First Post",
        "content": "This is my first post!"
      }
    }
  }
}
```
The form should have two input fields for title and content. The form should also have a submit button. When the submit button is clicked, the form data should be sent to the api and the response should be displayed in the browser.

Here is a sample react component that implements the on submit function:
```
import React, { useState } from 'react';

function Form() {
  const [title, setTitle] = useState('');
  const [content, setContent] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();

    const data = {
      title,
      content,
    };

    fetch('https://api.graphql.com/graphql', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        query: `
          mutation {
            createPost(input: {
              title: "${title}",
              content: "${content}"
            }) {
              post {
                title
                content
              }
            }
          }
        `,
      }),
    })
      .then((response) => response.json())
      .then((data) => console.log(data))
      .catch((error) => console.error(error));
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Title:
        <input
          type="text"
          value={title}
          onChange={(event) => setTitle(event.target.value)}
        />
      </label>
      <label>
        Content:
        <textarea
          value={content}
          onChange={(event) => setContent(event.target.value)}
        />
      </label>
      <button type="submit">Submit</button>
    </form>
  );
}

export default Form

